import React from 'react';
import ReactDOM from 'react-dom';
import './css/style.css';
import 'bootstrap/dist/css/bootstrap.css';
import './img/UMBC-bg2.png'
// import 'jquery/dist/css/jquery.js';
// import './js/bootstrap.min.js';
// import './js/jquery.min.js';
import './js/main.js';
// import App from './App';
import About from './js/About';
import * as serviceWorker from './serviceWorker';

// ReactDOM.render(<App />, document.getElementById('root'));
ReactDOM.render(<About />, document.getElementById('about'));
// ReactDOM.render(<Faq />, document.getElementById('faq'));
// ReactDOM.render(<Sponsor />, document.getElementById('sponsor'));
// ReactDOM.render(<SocialMedia />, document.getElementById('social_media'));
// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
